<template>
  <div>
    <Slider texto="Peliculas"></Slider>

    <div class="center">
      <section id="content">
        <h2 class="subheader">Peliculas</h2>

        <div v-if="misDatos">
          <h3 v-html="misDatos">{{misDatos}}</h3>
        </div>
        
        <h3>{{this.apellido | mayusculas}}</h3>

        <div v-if="favorita">
          <h3>Favorita:  {{favorita.title}}</h3>
        </div>

        <!--Listado articulos-->
        <div id="articles">
          <div v-for="pelicula in peliculasMayuscula" v-bind:key="pelicula.title">
            <Pelicula :pelicula="pelicula" v-on:favorita="haLlegadoFavorita"/>
          </div>
          <!--AÃ±adir Articulos via JS-->
        </div>
      </section>

      <Sidebar></Sidebar>
      <div class="clearfix"></div>
    </div>
  </div>
</template>

<script>
import Pelicula from "./Pelicula.vue";
import Slider from "./Slider.vue";
import Sidebar from "./Sidebar.vue";

export default {
  name: "Peliculas",
  components: {
    Pelicula,
    Slider,
    Sidebar,
  },
  computed:{
    peliculasMayuscula(){
       var peliculasMod = this.peliculas;
      for(var i=0;i<this.peliculas.length;i++){
        peliculasMod[i].title = peliculasMod[i].title.toUpperCase();
      }
      return peliculasMod;
    },
    misDatos(){
      return this.nombre + '<br/>'+this.apellido;
    }
  },
  methods:{
    haLlegadoFavorita(favorita){
      console.log("padre");
      console.log(favorita);
      this.favorita=favorita;
    }
  },
  filters:{
    mayusculas(value){
      return value.toUpperCase();
    }
  },
  data() {
    return {
      nombre: 'Alvaro',
      apellido: 'Escobar',
      favorita: null,
      peliculas: [
        {
          title: "Batman vs superman",
          year: 2015,
          image:
            "data:image/jpeg;base64,",
        },
        {
          title: "Soul",
          year: 2020,
          image:
            "data:image/jpeg;base64,",
        },
        {
          title: "Spiderman",
          year: 2016,
          image:
            "data:image/jpeg;base64,",
        },
        {
          title: "Ozark",
          year: 2019,
          image:
            "data:image/jpeg;base64,",
        },
        {
          title: "Godzilla vs Kong",
          year: 2021,
          image:
            "data:image/jpeg;base64,",
        },
      ],
    };
  },
};
</script>